import React from "react";
import PropTypes from 'prop-types'

function TodoItem(props) {
	return (
		<li>
			<strong>{props.idx + 1} </strong>
			{props.todo.title}
		</li>
	);
}

TodoItem.propTypes = {
	idx: PropTypes.number
}
export default TodoItem;
